Dan Quichotte, journaliste un peu frileux, est reveille par son ancetre, Don Quichotte qui lui reproche sa couardise. Il se sent alors investi d'une mission: Enqueter sur la Madoff Compagny (une societe aux affaires pour le moins douteuses). Flanque de Sancho et Panza (sa bonne et mauvaise conscience), il part en croisade. Au cours de sa longue quete pour la verite, il va rencontrer de nombreux personnages de la litterature.

